import React, { Component } from 'react';
import Header from '../Commons/Header';
import Dashboard from "../menu/Dashboard";

import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';


import '../../css/skeleton.css';
import '../../css/Products.css';


const CustomTableCell = withStyles(theme => ({
    head: {
      backgroundColor: theme.palette.common.black,
      color: theme.palette.common.white,
    },
    body: {
      fontSize: 14,
    },
  }))(TableCell);

const styles = theme => ({
    root: {
        width: '95%',
        marginTop: theme.spacing.unit * 3,
        padding: '10px',
        overflowX: 'auto',
    }
});

class NewEntry extends Component {
    render() {
        const { classes } = this.props;
        return (
            <section>
                <Header></Header>
                <div className="do-work">
                    <section>
                        <Dashboard option="Entrada de almacén"></Dashboard>
                    </section>
                    <section className="form-data">
                        <h5>Nueva entrada</h5>
                        <hr />
                        <div>
                            <Paper className={classes.root}>
                                <div>
                                    <div className="ten columns">
                                        <label >Proveedor</label>
                                        <input className="u-full-width" type="text" placeholder="Nombre del proveedor" id="exampleEmailInput"></input>
                                    </div>
                                    <div>
                                        
                                    <Table >
                                    <TableHead>
                                        <TableRow>
                                            <CustomTableCell >No entrada</CustomTableCell >
                                            <TableCell align="right">Fecha creación</TableCell>
                                            <TableCell align="right">Estado</TableCell>
                                            <TableCell align="right">Valor</TableCell>
                                            <TableCell align="center">Opciones</TableCell>
                                        </TableRow>
                                    </TableHead>
                                    <TableBody>
                                     
                                    </TableBody>
                                </Table>
                                    </div>
                                </div>
                            </Paper>
                        </div>
                    </section>
                </div>

            </section>

        )
    }
}
export default withStyles(styles)(NewEntry);
